import React, { Component } from 'react'

export default class Testeee extends Component {
  constructor() {
    super()

    this.state = {
      username:null,
      password:null,

    }
  }
dokhol(){
  console.warn("form data", this.state)
}
  render() {

    return (
      <div>
        <form >
          <div>
            <input
              type="text"
  value={this.username}
              onChange={(event)=>{this.setState({username:event.target.value})}}
            />
          </div>
          <div>
            <input
              type="text"
value={this.password}
          onChange={(event)=>{this.setState({password:event.target.value})}}
            />
          </div>

          <button type="submit" onclick={()=>this.dokhol()}>Submit</button>
        </form>
      </div>
    )
  }
}
